const calculator = (arr) => {
	var result = 0;
	var type = "";

	var index;
	for (index = 0; index < arr.length; ++index) {
		result += arr[index] * Math.pow(10, index);
	}
	// result = result + 99 * Math.pow(10, arr.length);

	const rand = Math.floor(Math.random() * 16);
	const resultArr = [
		"dentist",
		"developer",
		"employee",
		"flight",
		"freshmen",
		"hero",
		"hwata",
		"ingukgong",
		"karaoke",
		"mask",
		"pediatric",
		"poop",
		"surgeon",
		"travel",
		"unemployed",
		"youtuber",
	];
	type = resultArr[rand];

	return type;
};

export default calculator;
